import React from 'react';
import './App.css';
import PrWarmup from '.components/PrWarmup';
import ReverseMax from '.components/ReverseMax';
import SetPlanner from '.components/SetPlanner'

function App() {
  return (
    <div className="App">
      <header className="App-header">Liftility</header>
      <PrWarmup/>
      <ReverseMax/>
      <SetPlanner/>
    </div>
  );
}

export default App;
